import "../../assets/components_css/main.css";
import Button from "../reusable_component/Button";
import activeRocket from "../../assets/images/RocketLaunch.svg";

const Creators = () => {
  return (
    <section className="creators container">
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          marginBottom: "6rem",
        }}
      >
        <div>
          <h2 className="secondary-header">Top Creators</h2>
          <p className="collection-after-text">
            Checkout Top Rated Creators on the NFT Marketplace
          </p>
        </div>

        <div style={{ display: "flex", alignItems: "end" }}>
          <Button
            padding={"1.9rem 5rem"}
            altText={"user icon"}
            imgSrc={activeRocket}
            btnName={"View Ranks"}
            bgColor={"transparent"}
            borderColor={"#A259FF"}
            borderStyle={"solid"}
          />
        </div>
      </div>

      <Card />
    </section>
  );
};

export default Creators;
